(18, '22018', '118', NULL, 1, 2, 'Kenya', 4, 'Luwu Utara, Sulawesi Selatan', 'MoU-22042', '0', NULL, 'Sustainable Farming in Tropical Asian Landscapes (SFITAL)', 'The Sustainable Farming in Tropical Asian Landscapes (SFITAL) is a five-year researchin-development project funded by International Fund for Agriculture and Development\n(IFAD) to link small-scale producers to global supply chains in an environmentally\nsustainable, economically viable and socially responsible manner. With regards to the\nabove objective, measuring the baseline of ecosystem services under various land covers,\nparticularly tree-based systems is an important step for ensuring a robust monitoring and\nevaluation system of sustainable cacao development in North Luwu. ', '294.532.000', 691, '2022-07-15', '2022-07-15', '2022-02-28', 1, 1, 'Universitas Hasanuddin', 'Jl. Perintis kemerdekaan km 10, Kampus Unhas Tamalanrea 90245', 'Dr. Ir. Asmita Ahmad, ST., M.Si.', 'Ketua Program Studi', 'Prof. Dr. Ir. Salengke, M.Sc.', 'Dekan Fakultas Pertanian', 'salengke@unhas.ac.id', NULL, '25', 232, NULL, '[\"ILMU TANAH - S1\"]', '[\"ICRAF\",\"Universitas Hasanuddin\"]', '2022-10-01 05:44:44', '2022-10-01 05:44:44'),
