(206, 'MoA-22202', 'Ilham, SS.,M.Hum.', NULL, 1, 1, 'Indonesia', 1, 'Makassar', 'MoU-22117', '9158/UN4.8.7/HK.07.00/2022', '0590/F7.10/KB.15.08/2022', 'PERJANJIAN KERJA SAMA DI BIDANG AKADEMIK, PENELITIAN, DAN PENGABDIAN', 'Kerja sama ini dilakukan dalam lingkup akademik, penelitian, dan pengabdian dengan prinsip mengoptimalkan kemitraan yang saling memberi manfaat yang teknisnya akan diatur lebih lanjut dalam aturan teknis dengan rincian kegiatan seperti magang, studi proyek independen, penelitian kolaboratif, pengabdian masyarakat, kolaborasi pertemuan ilmiah bersama, penerbitan tulisan sejarah dan budaya, serta penyelenggaraan kegiatan sejarah dan budaya.', NULL, 999, '2022-09-01', '2022-09-01', '2027-09-01', 1, 5, 'Universitas Hasanuddin', 'Alamat: Jalan Perintis Kemerdekaan Kampus Tamalanrea, KM.10 Makassar  Kode POS 90245', 'Dr. Ilham, S.S, M.Hum', 'Ketua Departemen Ilmu Sejarah', NULL, NULL, NULL, NULL, '24', 37, NULL, '[\"ILMU SEJARAH - S1\"]', '[\"Universitas Hasanuddin\",\"Balai Pelestarian Cagar Budaya Gorontalo\"]', '2022-10-25 03:25:08', '2022-10-25 03:25:08'),
