(208, 'MoA-22208', 'Ilham, SS.,M.Hum.', NULL, 1, 1, 'Indonesia', 1, 'SULAWESI SELATAN', 'MoU-22109', '9159/UN4.8.7/HK.07.00/2022', '0987/F7.17/KB.01.01/2022', 'PERJANJIAN KERJA SAMA DI BIDANG AKADEMIK, PENELITIAN,  DAN PENGABDIAN', 'Kesepakatan ini mencakup kerja sama antara instansi terlibat dalam rangka Akademik, Penelitian, dan Pengabdian dengan prinsip mengoptimalkan kemitraan yang saling memberikan manfaat yang teknisnya akan diatur lebih lanjut dalam aturan teknis dengan rincian kegiatan seperti magang atau praktik kerja, studi proyek independen, penelitian kolaboratif, pengabdian masyarakat, kolaborasi pertemuan ilmiah bersama, penerbitan tulisan sejarah dan budaya, dan penyelenggaraan kegiatan sejarah dan budaya.', NULL, NULL, '2022-09-26', '2022-09-26', '2027-09-26', 1, 5, 'Universitas Hasanuddin', 'Jalan. Perintis Kemerdekaan Km. 10 Makassar, Sulawesi Selatan', 'Dr. Ilham, S.S, M.Hum', 'Kepala Departemen Ilmu Sejarah', NULL, NULL, NULL, NULL, '24', 37, NULL, '[\"ILMU SEJARAH - S1\"]', '[\"Universitas Hasanuddin\",\"Badan Pelestarian Nilai Budaya Sulawesi Selatan\"]', '2022-10-25 03:56:18', '2022-10-25 03:56:18'),
(209, 'MoA-22209', 'Amrullah Amir, SS.,MA.', NULL, 1, 1, 'Indonesia', 1, 'Desa Tosora, Kecamatan Majauleng,  Kabupaten Wajo', 'MoU-22087', '2696/UN4.9.7/Hk.07.00/2022', '146.5/03-PKS/TSR/III/2022', 'KERJASAMA DALAM PENGEMBANCAI! DESA BINAAN PADA BIDANG PENDIDIKAN, PENELITIAI\\. DAN PENGABDIAN KEPADA MASYARAKAT', 'Para pihak  sepakat untuk menciptakan kerja sama dalam rangka pengembangan desa\nbinaan pada bidang pendidikan, penelitian dan pengabdian masyarakat dengan prinsip\nmengoptimalkan kemitraan yang saling memberikan manfaat yang teknisnya akan diatur\nlebih lanjut dalam aturan teknis dengan rincian kegiatan sebagai berikut:\na. Pendidikan;\nb. Penelitian;\nc. Pengabdian Kepada Masyarakat.', NULL, NULL, '2022-03-26', '2022-03-26', '2027-03-26', 1, 5, 'Universitas Hasanuddin', 'Jl. Perintis Kemerdekaan KM. l0 Tamalanrea, Makassar, Sulawesi Selatan', 'Dr. Ilham, S.S., M.Hum dan Amrullah Amir, M.A., Ph.D ', 'Ketua Departemen Ilmu Sejarah dan Ketua Prodi Magister Sejarah', NULL, NULL, NULL, NULL, '24', 211, NULL, '[\"Sejarah - S2\"]', '[\"Universitas Hasanuddin\",\"PEMERINTAH DESA TOSORA\"]', '2022-10-25 05:15:58', '2022-10-25 05:15:58'),
